StatusCategory_1.query:
q = load "${App.Datasets.ServiceAppointmentApptDemo.FullyQualifiedName}";
q = filter q by 'StatusCategory' in ["CannotComplete", "Completed"];
q = group q by 'StatusCategory';
q = foreach q generate 'StatusCategory' as 'StatusCategory', count() as 'count';
q = order q by 'StatusCategory' asc;
q = limit q 2000;
